import React from 'react';
import { useHistory } from 'react-router-use-history';
import { Modal, ModalHeader } from 'react-bootstrap';
import './Table.css';



const OpenFormButton = () => {

  return (

    <div>
      <Modal>
        <ModalHeader>Rake move</ModalHeader>
      </Modal>
    </div>
  );
};

export default OpenFormButton;
